meet his\u00a0\u201chusband\u201d at some point now.<\/p>\n<p>Aaron: \u2026Miles\u2026I love you, and I am proud of you\u2026but you are somehow the smartest and <i>dumbest<\/i>\u00a0boy I have ever known.<\/p>\n<p>Miles: Says the man who used his big brain to become a criminal when he could\u2019ve been a black Tony Stark with that gear he made. And thought working for the Kingpin, who everyone knows will throw his minions away like tissues, was a good idea!<\/p>\n<p>Peter: He makes a good point, babe, you did kind of mess up first\u2013<\/p>\n<p>Aaron: Call me babe again and see what happens. I\u2019ll whoop you with a collapsed lung.<\/p>\n<\/blockquote>\n\n<p>All I see is \u201cfake marriage au, but it\u2019s also enemies to lovers\u201d<\/p>\n<\/blockquote>",
